INSERT INTO `dish` VALUES (3,'Veggie Pasta Primavera',_binary 'https://cdn.loveandlemons.com/wp-content/uploads/2022/06/pasta-primavera-1.jpg',0,'dinner','Veggie Pasta Primavera is a delightful medley of fresh vegetables tossed with pasta in a light lemony sauce. It\'s the perfect dish for showcasing your favorite summer veggies. Full of flavor, color, and texture, this meal comes together quickly and is sure to satisfy everyone at the table. The lemon adds a zing that pairs well with the robust flavors of the vegetables, while the pasta provides a satisfying base. It\'s a versatile dish that can be adjusted based on your preferred vegetables or whatever you have on hand. It\'s also an excellent way to incorporate more vegetables into your diet in a delicious way.','You can use any type of pasta you prefer for this dish. Whole wheat pasta can add a bit of fiber and a nutty flavor. Try adding a sprinkle of red pepper flakes for a bit of heat, or a handful of chopped fresh herbs for an added layer of flavor. Feel free to swap out any of the vegetables for your favorites or whatever is in season. Roasting the vegetables can also add a deeper flavor profile. This dish is best served fresh, but leftovers can be stored in the refrigerator for up to three days and reheated in the microwave or on the stovetop.'),(4,'Tropical Fruit Salad',_binary 'https://www.jessicagavin.com/wp-content/uploads/2021/06/tropical-fruit-salad-26-1200.jpg',0,'dessert','This tropical fruit salad is a refreshing and healthy dessert or breakfast option. It\'s a mix of vibrant tropical fruits like mango, pineapple, kiwi, and more. The natural sweetness of the fruits provides all the flavor you need, but a drizzle of honey can be added for extra sweetness. The salad is best served chilled, so consider making it ahead of time and refrigerating it for a few hours before serving.','Feel free to adjust the types and quantities of fruit based on your preferences or what\'s available. You could also add a squeeze of lime or lemon juice for a bit of tang, or sprinkle some shredded coconut on top for extra tropical flavor. This salad is best enjoyed the day it\'s made, but leftovers can be stored in the refrigerator for a day or two.'),(5,'Classic Beef Stir Fry',_binary 'https://static.independent.co.uk/2022/05/24/10/newFile-3.jpg',1,'dinner','This classic beef stir fry is a quick and hearty dish perfect for a weeknight dinner. Marinated slices of beef are stir-fried with a medley of colorful vegetables, all coated in a flavorful soy-based sauce. The recipe is adaptable to whatever vegetables you have on hand, just make sure to slice them thin so they cook quickly. Serve the stir fry over cooked rice for a satisfying meal.','Make sure to preheat your pan before adding the beef to achieve a nice sear. Don\'t crowd the pan when frying the beef; you may need to cook it in batches to ensure it browns instead of steams. Also, cutting your vegetables into uniform sizes will ensure even cooking. For added flavor, you can also add minced ginger or a bit of chili sauce for heat.'),(6,'Hearty Chicken Soup',_binary 'https://www.allrecipes.com/thmb/yWQ6Mxd6rrmOCLy1T6DX6BHLjf0=/1500x0/filters:no_upscale():max_bytes(150000):strip_icc()/7864870-hearty-chicken-and-rice-soup-Christina-1x1-1-e399f2efd5f9405a8d4d636664359264.jpg',1,'lunch','This hearty chicken soup is the perfect comfort food for a chilly day. It\'s loaded with vegetables, tender chunks of chicken, and a savory broth. The soup is quite filling on its own thanks to the chicken and vegetables, but you can serve it with a side of bread for an even more satisfying meal. This is a great recipe for using up leftover chicken, and the soup can easily be customized with your favorite vegetables or seasonings.','For a thicker soup, you can add some cooked rice or noodles. This soup is great for meal prep and freezes well; just leave out any pasta or rice if freezing, and add it in when reheating. For added flavor, you can also add some dried herbs like thyme or oregano, or a sprinkle of grated parmesan cheese on top just before serving.'),(7,'Oatmeal with Fresh Fruits',_binary 'https://i0.wp.com/ahintofrosemary.com/wp-content/uploads/2017/06/DSC_0048.jpg?fit=3479%2C2329&ssl=1',0,'breakfast','Start your day with a bowl of hearty oatmeal topped with fresh fruits. This breakfast is not only delicious but also packed with nutrients and fiber that will keep you feeling full throughout the morning. You can cook the oats in water or milk for a creamy texture and then top them with a mix of your favorite fruits. A drizzle of honey or a sprinkle of cinnamon can add a touch of sweetness.','You can customize this recipe by using your favorite types of fruit, or whatever you have on hand. Some great options include berries, bananas, peaches, or apples. You could also add some nuts or seeds for a bit of crunch, or a spoonful of yogurt for some creaminess. If you prefer your oatmeal a bit sweeter, you can add some brown sugar or maple syrup.'),(8,'Quinoa Salad with Grilled Vegetables',_binary 'https://www.deliciousmagazine.co.uk/wp-content/uploads/2020/02/069-roasted-vegetable-salad-768x960.jpg',0,'lunch','This quinoa salad with grilled vegetables is a delicious and nutritious meal that\'s perfect for lunch or dinner. The salad features a blend of fluffy quinoa, colorful grilled veggies, and a tangy vinaigrette. The combination of textures and flavors makes for a satisfying dish that\'s full of nutrients. Plus, this salad can be served warm or cold, making it great for meal prep or a picnic.','You can customize this salad by using your favorite vegetables, or whatever is in season. Zucchini, bell peppers, onions, and tomatoes are all great options. For the vinaigrette, a simple blend of olive oil, vinegar, lemon juice, and your favorite herbs can be used. You could also add some grilled chicken or tofu for extra protein. If storing for later, keep the vinaigrette separate and mix it in just before serving to keep the vegetables and quinoa from becoming soggy.'),(10,'Grilled Salmon with Lemon and Dill',_binary 'https://www.simplyrecipes.com/thmb/dHQOaU9YEDErpq03ic1CAg5pZN8=/1500x0/filters:no_upscale():max_bytes(150000):strip_icc()/__opt__aboutcom__coeus__resources__content_migration__simply_recipes__uploads__2013__06__grilled-salmon-dill-butter-horiz-640-887464d180534e0e9b0e009c50e96e23.jpg',1,'dinner','This grilled salmon recipe is a simple and delicious way to prepare this healthy fish. The salmon is seasoned with a mix of fresh dill, lemon zest, and a bit of olive oil, then grilled to perfection. The result is a flaky, flavorful fish that\'s perfect for a healthy lunch or dinner. Serve it with a side of steamed vegetables or a fresh salad for a complete meal.','It\'s best to use fresh salmon for this recipe, if possible. If you\'re using frozen salmon, make sure to fully thaw it before grilling. Also, be careful not to overcook the salmon; it should be just cooked through and still a bit pink in the center. For a slightly smoky flavor, you can grill the lemon slices before squeezing their juice onto the salmon.'),(11,'Vegetable Pasta Primavera',_binary 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR9oPFRX9D0VGbbYynROyYm3zGH1eTcH4UF5Q&usqp=CAU',0,'dinner','Pasta Primavera is a classic Italian dish that\'s loaded with fresh, vibrant vegetables. In this recipe, pasta is tossed with a rainbow of saut√©ed vegetables, then finished with a sprinkle of parmesan and a squeeze of fresh lemon. It\'s a quick and easy meal that\'s perfect for weeknight dinners or when you need to use up leftover vegetables.','You can use any vegetables you like or have on hand for this recipe. Some good options include bell peppers, zucchini, broccoli, and tomatoes. For added protein, you can also add some cooked chicken or shrimp. To make this dish vegan, simply omit the parmesan or replace it with a vegan alternative.'),(12,'Roasted Beet and Goat Cheese Salad',_binary 'https://hungryhealthyhappy.com/wp-content/uploads/2019/07/beetroot-and-goats-cheese-salad-featured.jpg',0,'lunch','This roasted beet and goat cheese salad is a delicious and healthy meal that\'s as beautiful as it is tasty. The earthy sweetness of the roasted beets pairs perfectly with the creamy goat cheese and the crunchy nuts. A simple vinaigrette made with olive oil and vinegar balances out the flavors. This salad is perfect for a light lunch or as a side dish with dinner.','The beets can be roasted ahead of time and kept in the fridge until you\'re ready to make the salad. You can also use golden beets or a mix of red and golden for a more colorful salad. If you\'re not a fan of goat cheese, you can substitute it with feta or blue cheese. To make the salad more filling, you can add some grilled chicken or tofu.'),(13,'Mango and Coconut Smoothie',_binary 'https://www.my-vb.com/sites/default/files/styles/image_recette/public/2020-08/0527-boiron%20Drink%20recipes%28editable%29-14_0.jpg?itok=PMtqYKOW',0,'breakfast','This mango and coconut smoothie is a refreshing and tropical treat that\'s perfect for breakfast or a snack. The sweet mango pairs perfectly with the creamy coconut milk, and a squeeze of lime adds a bit of tartness. This smoothie is also a great way to stay hydrated on a hot day. Add some chia seeds or flaxseeds for added nutrition.','For a colder smoothie, you can use frozen mango or add a handful of ice cubes. If the smoothie is too thick, add a bit more coconut milk or some water. For added sweetness, add a spoonful of honey or agave syrup. For a protein boost, add a scoop of your favorite protein powder.'),(14,'Roasted Brussels Sprouts with Bacon',_binary 'https://www.seriouseats.com/thmb/6xkxqbKBxo81FHXgWfVZKgcUzpE=/1500x0/filters:no_upscale():max_bytes(150000):strip_icc()/12.brusselssprouts-beautyshot-d2b1a7046ca547b593d51fa352ee8dab.jpg',1,'dinner','These roasted Brussels sprouts with bacon are a delicious and satisfying side dish that\'s perfect for any meal. The Brussels sprouts are roasted until they\'re crispy on the outside and tender on the inside, and the bacon adds a smoky, savory flavor. Tossed with a bit of olive oil, salt, and pepper, this dish is simple yet flavorful.','For the best flavor, use fresh Brussels sprouts if possible. If you\'re using frozen Brussels sprouts, make sure to thaw them completely and pat them dry before roasting. For a vegetarian version, you can omit the bacon or replace it with a vegetarian alternative. You can also add some grated parmesan or a squeeze of lemon for extra flavor.'),(15,'Avocado and Egg Toast',_binary 'https://www.skinnytaste.com/wp-content/uploads/2015/01/Avocado-Toast-with-Egg-7.jpg',0,'breakfast','Avocado and egg toast is a healthy, filling, and delicious breakfast option. Creamy avocado, a perfectly cooked egg, and a dash of salt and pepper are layered on top of a piece of crunchy toast. It\'s simple to make and packed with healthy fats and protein to keep you satisfied all morning.','Use ripe avocados for best flavor. For the eggs, you can prepare them as per your preference: poached, fried, or scrambled. If you\'d like, you can add some extras like a sprinkle of cheese, some cooked bacon, or a dash of hot sauce.'),(16,'Chicken Stir-Fry with Vegetables',_binary 'https://www.allrecipes.com/thmb/xvlRRhK5ldXuGcXad8XDM5tTAfE=/1500x0/filters:no_upscale():max_bytes(150000):strip_icc()/223382_chicken-stir-fry_Rita-1x1-1-b6b835ccfc714bb6a8391a7c47a06a84.jpg',1,'dinner','This chicken stir-fry with vegetables is a quick and easy dinner option that is also healthy and full of flavor. It consists of chicken and a variety of colorful vegetables, all cooked together in a delicious stir-fry sauce. Serve it over a bed of rice or noodles for a complete meal.','Feel free to swap out or add in any vegetables you have on hand. Just remember to cut all your ingredients into similar-sized pieces so they cook evenly. Additionally, marinating the chicken in a bit of the stir-fry sauce before cooking can add an extra layer of flavor.'),(17,'Blueberry and Banana Smoothie',_binary 'https://lovingitvegan.com/wp-content/uploads/2022/03/Blueberry-Banana-Smoothie-Square.jpg',0,'breakfast','This blueberry and banana smoothie is a healthy and delicious way to start your day. Packed with antioxidants from the blueberries, and energy-boosting nutrients from the bananas, this smoothie is also a great post-workout snack. You can add some yogurt or almond milk to make it creamier.','If you want the smoothie to be cold, you can freeze the fruits beforehand. You can also add some chia seeds or flaxseeds for an extra boost of fiber and omega-3 fatty acids. If you\'d like it sweeter, consider adding a spoonful of honey or agave syrup.'),(18,'Pasta with Tomato and Basil',_binary 'https://static01.nyt.com/images/2015/07/27/dining/27SPAGHETTI/27SPAGHETTI-articleLarge.jpg',0,'dinner','This classic pasta dish with tomato and basil is a quick and easy dinner option. The fresh flavors of ripe tomatoes and basil meld perfectly with the olive oil and garlic, creating a sauce that is both light and satisfying. Top it off with some grated Parmesan cheese for an added touch of richness.','Use a pasta shape that can hold onto the sauce well, like penne or fusilli. You can also add some cooked chicken or shrimp for extra protein. If you don\'t have fresh basil, dried basil can be used instead, but the flavor will be slightly different.'),(19,'Chicken and Vegetable Soup',_binary 'https://www.kitchensanctuary.com/wp-content/uploads/2018/01/Lighter-Creamy-Chicken-and-Vegetable-Soup-Recipe-square-FS.jpg',1,'dinner','This wholesome chicken and vegetable soup is hearty, nutritious and perfect for a cold day. This recipe features a variety of vegetables, chicken, and a rich broth, offering a symphony of flavors that\'s both satisfying and comforting.','Feel free to add more vegetables or herbs of your choice. Serve hot with a slice of crusty bread for a perfect winter meal. The soup can be stored in the fridge for up to 5 days or can be frozen for up to 3 months.'),(20,'Berry and Yogurt Parfait',_binary 'https://food.fnr.sndimg.com/content/dam/images/food/fullset/2014/4/11/1/BW2D09_Yogurt-Berry-Parfait_s4x3.jpg.rend.hgtvcom.616.462.suffix/1397359642717.jpeg',0,'breakfast','Berry and yogurt parfait is a quick and easy breakfast or dessert option. It layers creamy yogurt, a variety of fresh berries, and crunchy granola to create a delightful and healthy treat.','Use any variety of berries you prefer. You can also replace granola with your favorite nuts or seeds. For a vegan version, replace regular yogurt with a dairy-free alternative.'),(21,'Grilled Cheese Sandwich',_binary 'https://cdn.loveandlemons.com/wp-content/uploads/2023/01/grilled-cheese-sandwich.jpg',0,'lunch','The grilled cheese sandwich is a classic comfort food, featuring melty cheese enveloped in crispy, golden brown bread. It\'s easy to make and can be enjoyed for lunch, dinner, or as a hearty snack.','You can use any kind of cheese you like, but a good melting cheese like cheddar, mozzarella, or Gruyere works best. Serve it with a bowl of tomato soup for a classic combo.'),(22,'Stir-Fried Beef with Broccoli',_binary 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT1-u4WFtRRoK3JAy3pz5tma7FJGh1lxjqZfA&usqp=CAU',1,'dinner','Stir-Fried Beef with Broccoli is a classic Chinese dish, featuring tender slices of beef and crisp broccoli florets in a savory and slightly sweet sauce. It\'s a quick and easy dish that\'s full of flavor.','Slice the beef against the grain to ensure it\'s tender. You can also add other vegetables like bell peppers or mushrooms for more variety. Serve it with steamed rice for a complete meal.'),(23,'Guacamole',_binary 'https://i2.wp.com/www.downshiftology.com/wp-content/uploads/2019/04/Guacamole-1-2.jpg',0,'snack','Guacamole is a classic Mexican dip made from ripe avocados, lime juice, onions, and cilantro. It\'s a versatile dip that\'s perfect for parties, barbecues, or as a topping for Mexican dishes.','Make sure to use ripe avocados for a creamy texture. You can add other ingredients like tomatoes or jalapenos for more flavor. Serve it with tortilla chips or as a topping for tacos or nachos.'),(24,'Greek Salad',_binary 'https://www.simplyrecipes.com/thmb/hcdnhU89fQgsmMkeppMwHx4TKnk=/1500x0/filters:no_upscale():max_bytes(150000):strip_icc()/__opt__aboutcom__coeus__resources__content_migration__simply_recipes__uploads__2011__08__dads-greek-salad-horiz-a-1600-bc71b85bc907414a9bb3179a923b58fc.jpg',0,'lunch','Greek Salad is a refreshing and crunchy dish made with tomatoes, cucumbers, olives, and feta cheese, all tossed in a tangy vinaigrette. It\'s a classic Mediterranean salad that\'s perfect for a light lunch or a side dish.','Use fresh and ripe vegetables for the best flavor. You can also add other ingredients like bell peppers or red onions. This salad is best served immediately but can be stored in the fridge for up to 2 days.'),(25,'Vegetable Stir-Fry',_binary 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRTNzctWVngeuJ6-iDx1SBXR_KhKT7hmoMk7Q&usqp=CAU',0,'dinner','Vegetable Stir-Fry is a quick and healthy dish that\'s full of vibrant vegetables cooked until tender-crisp in a savory sauce. It\'s a versatile recipe that you can customize with your favorite vegetables.','You can use any combination of vegetables you like. Some good options include bell peppers, carrots, mushrooms, broccoli, and snow peas. Serve the stir-fry over cooked rice or noodles for a complete meal.'),(26,'Pasta Primavera',_binary 'https://www.cookingclassy.com/wp-content/uploads/2018/09/pasta-primavera-2.jpg',0,'dinner','Pasta Primavera is a delightful pasta dish that combines tender pasta and a colorful array of fresh vegetables. The vegetables are briefly saut√©ed to keep them crisp and colorful, and then tossed with the pasta and a light sauce.','You can use any variety of pasta and vegetables you like. For a creamier sauce, add a splash of cream or a dollop of cream cheese. Top with freshly grated Parmesan cheese before serving.'),(27,'Quinoa Salad',_binary 'https://cookieandkate.com/images/2017/08/best-quinoa-salad-recipe-3.jpg',0,'lunch','Quinoa Salad is a delicious and healthy salad that\'s packed with protein and fiber. The salad features cooked quinoa, a variety of vegetables, and a tangy vinaigrette, making it a nutritious and satisfying meal.','You can add other ingredients like chickpeas, feta cheese, or toasted nuts for more flavor and texture. The salad can be made in advance and stored in the fridge for up to 3 days, making it a great option for meal prep.'),(28,'Vegetable Omelette',_binary 'https://images.eatsmarter.com/sites/default/files/styles/1600x1200/public/vegetable-omelet-with-penne-619282.jpg',0,'breakfast','A vegetable omelette is a quick, easy and healthy breakfast option. Made with eggs and a variety of vegetables, this omelette is a great way to start your day with a serving of protein and veggies.','Feel free to use any vegetables you have on hand. You could also add cheese or herbs for more flavor. Serve the omelette with a slice of whole-grain toast for a balanced breakfast.'),(29,'Mango Smoothie',_binary 'data:image/jpeg;base64,',0,'breakfast','This mango smoothie is a refreshing and delicious drink that\'s perfect for breakfast or a snack. Made with ripe mangoes, yogurt, and a touch of honey, it\'s a healthy and satisfying treat.','For the creamiest smoothie, use ripe mangoes and full-fat yogurt. You can also add other fruits like bananas or strawberries, or boost the nutrition with a spoonful of chia seeds or flaxseeds.'),(30,'Baked Salmon with Lemon',_binary 'https://www.wellplated.com/wp-content/uploads/2018/06/Baked-Salmon-in-Foil-at-400.jpg',1,'dinner','Baked salmon with lemon is a simple and healthy dinner option. The salmon is seasoned with a little salt and pepper, drizzled with olive oil and lemon juice, and then baked until tender and flaky.','For the best flavor, use fresh salmon fillets and squeeze the lemon juice just before using. Serve the salmon with a side of steamed vegetables or a fresh salad for a complete meal.'),(31,'Roasted Chicken with Vegetables',_binary 'https://www.spendwithpennies.com/wp-content/uploads/2018/11/SpendWithPennies-Juicy-Roast-Chicken-25.jpg',1,'dinner','Roasted chicken with vegetables is a hearty and satisfying meal that\'s perfect for a family dinner. The chicken is seasoned and roasted until golden and juicy, and the vegetables are cooked in the same pan, absorbing all the delicious flavors.','You can use any combination of vegetables you like, such as potatoes, carrots, and onions. For the juiciest chicken, let it rest for a few minutes before carving.'),(32,'Blueberry Pancakes',_binary 'https://www.allrecipes.com/thmb/ecb0XKvcrE7OyxBLX3OVEd30TbE=/1500x0/filters:no_upscale():max_bytes(150000):strip_icc()/686460-todds-famous-blueberry-pancakes-Dianne-1x1-1-9bd040b975634bce884847ce2090de16.jpg',0,'breakfast','Blueberry pancakes are a sweet and fluffy breakfast treat. These pancakes are made with a basic batter and filled with fresh blueberries, then cooked until golden and served with a drizzle of maple syrup.','For the fluffiest pancakes, don\'t overmix the batter and let it rest for a few minutes before cooking. You can also use other fruits like bananas or strawberries instead of blueberries.'),(33,'Strawberry Shortcake',_binary 'https://cdn.loveandlemons.com/wp-content/uploads/2020/06/strawberry-shortcake-500x500.jpg',0,'dessert','Strawberry shortcake is a classic dessert that features sweet biscuits, fresh strawberries, and whipped cream. The biscuits are split and filled with the strawberries and cream, creating a delicious and beautiful dessert.','For the best flavor, use ripe and juicy strawberries. You can also add a little sugar to the strawberries and let them macerate for a few minutes to release their juices.'),(35,'Raspberry Lemonade',_binary 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRG2kesB0AI2YVJJAKHgRjQQL1qtbgK0-dZVg&usqp=CAU',0,'snack','A refreshing, fruity beverage perfect for warm summer days. The combination of tart raspberries and tangy lemons creates a wonderful balance of flavors that is both sweet and sour. This homemade lemonade is far more flavorful than any store-bought version and will surely impress your guests.','You can use either fresh or frozen raspberries for this recipe. If you\'d like, you can strain the mixture through a fine-mesh sieve to remove the raspberry seeds. Add more sugar if you prefer your lemonade sweeter.'),(36,'Vegetable Stir Fry',_binary 'https://www.allrecipes.com/thmb/sJM3wA6mCvZ46ygU9zcIGTLSFOw=/1500x0/filters:no_upscale():max_bytes(150000):strip_icc()/222658-frozen-vegetable-stir-fry-2x1-1379-1fcd4cf97a5e467888fa2498e10c12e9.jpg',0,'dinner','A simple, quick, and healthy meal packed with a variety of colorful vegetables. This versatile dish allows you to use whatever vegetables you have on hand. The sauce is a flavorful mix of soy sauce, sesame oil, and garlic.','Serve this dish over a bed of steamed rice or noodles. You can also add protein such as tofu, chicken, or shrimp. Make sure to cut all your vegetables roughly the same size to ensure even cooking.'),(37,'Chicken Tacos',_binary 'https://divascancook.com/wp-content/uploads/2022/06/crockot-chicken-tacos-500x500.jpg',1,'lunch','A fun and flavorful meal that is a hit with all age groups. Tender and juicy chicken is cooked with a variety of spices, then served in a soft taco shell with your favorite toppings.','You can use either chicken breast or chicken thighs in this recipe. Top your tacos with shredded lettuce, diced tomatoes, shredded cheese, and a dollop of sour cream. For some heat, add some sliced jalapenos.'),(38,'Shrimp Scampi',_binary 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRtjSWTLQk9ZGM0LF9rnQvleSG0svTJOTpLlQ&usqp=CAU',1,'dinner','An elegant and flavorful pasta dish featuring succulent shrimp sauteed in a garlicky, buttery wine sauce. The rich, savory flavors of this dish are perfectly balanced by a squeeze of fresh lemon juice.','Be sure not to overcook the shrimp as they can become tough. You can substitute chicken broth for the white wine if desired. Pair this dish with a fresh salad for a complete meal.'),(39,'Beef and Broccoli',_binary 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRwA4FpBQ-j9LrJEqfMo1PEYP5JqJDI8N83YQ&usqp=CAU',1,'dinner','A Chinese restaurant favorite that you can easily make at home. This dish features tender strips of beef and fresh broccoli florets in a savory sauce. It\'s a delicious and filling dish that pairs perfectly with steamed rice.','Slice the beef against the grain for the most tender meat. You can also add other vegetables such as bell peppers or mushrooms to the stir-fry.'),(40,'Lemon Garlic Salmon',_binary 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRsY0ca7TfKwXmbKIWMGRoBguLOncEUmU3d6g&usqp=CAU',1,'dinner','A delicious, light and healthy dish with a tangy lemon garlic glaze. The salmon is oven-baked until tender and flaky. It\'s perfect for a quick and easy weeknight dinner that doesn\'t compromise on flavor.','Serve this dish with a side of steamed veggies and a portion of wild rice for a balanced meal. You can also garnish it with some fresh dill for an added touch of freshness.'),(41,'Veggie Omelette',_binary 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS8iWQEXdicK9eNBgYub2oSU2Q6L3mNMCMhOQ&usqp=CAU',0,'breakfast','A healthy and fulfilling breakfast option that\'s packed with colorful veggies. This veggie omelette is easy to make and versatile as you can add any vegetables you have on hand.','You can add some shredded cheese on top for extra flavor. Serve this omelette with a slice of whole wheat toast for a complete breakfast.'),(42,'Avocado Toast',_binary 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRw6mbLr5-vBROnkhrF5ud9F671RvbGX1R-Ag&usqp=CAU',0,'breakfast','A trendy and nutritious breakfast option that\'s easy to make and customizable to your taste. The creamy avocado pairs wonderfully with the crunchy toast, and the lemon juice adds a nice tang.','You can top your avocado toast with poached eggs, smoked salmon, or cherry tomatoes for extra flavor. A sprinkle of chili flakes can also give it a spicy kick.'),(43,'Chicken Fajitas',_binary 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRs0IyFH71dGIk6teuIDMKYwI5PNjirVGCmNA&usqp=CAU',1,'dinner','A flavorful and satisfying Mexican dish that\'s easy to put together. The chicken is seasoned and saut√©ed with colorful bell peppers and onions, then served with warm tortillas.','You can add some salsa, guacamole, and sour cream on the side for extra flavor. A squeeze of lime juice right before serving can also enhance the taste.'),(44,'Strawberry Banana Smoothie',_binary 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRtdwJDidLfHdzQJb26zDLaeGbgxufvMkkskA&usqp=CAU',0,'snack','A sweet and refreshing smoothie that\'s perfect for a quick breakfast or a healthy snack. The combination of strawberries and bananas is a classic one that never disappoints.','You can add a scoop of protein powder for extra nutrition. This smoothie can also be made ahead of time and stored in the fridge for a quick grab-and-go option.'),(45,'Spinach and Feta Stuffed Chicken',_binary 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTNp8VIFWAuuW-FU8jbLXpZoovWK-kBS1QkeQ&usqp=CAU',1,'dinner','A delicious and healthy dish that looks fancy but is actually quite easy to make. The chicken breasts are stuffed with a mixture of spinach, feta cheese, and garlic, then baked until golden and juicy.','You can serve this dish with a side of quinoa or brown rice, along with some roasted veggies. Feel free to substitute the feta cheese with goat cheese if you prefer.'),(46,'Mango Kiwi Smoothie',_binary 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQGkvGw6JiVyTTNwtvxzUBM6x8yvJr1J5Ozqg&usqp=CAU',0,'snack','A refreshing and nutritious smoothie that\'s perfect for a quick breakfast or a healthy snack. The tropical flavors of mango and kiwi will make you feel like you\'re on a beach vacation.','You can add a scoop of protein powder or a handful of spinach for extra nutrition. Feel free to substitute the almond milk with any other type of milk you prefer.'),(47,'Pumpkin Pie',_binary 'https://cdn.apartmenttherapy.info/image/upload/f_auto,q_auto:eco,c_fill,g_auto,w_1500,ar_3:2/k%2Farchive%2Fb1a6ff136745d5907e216412792f9430cf787585',0,'dessert','A classic dessert that\'s perfect for the fall season. The pumpkin filling is sweet and creamy, and the crust is buttery and flaky. This pie is sure to be a hit at any gathering.','You can serve this pie with a dollop of whipped cream or a scoop of vanilla ice cream. Make sure to let the pie cool completely before slicing to ensure clean cuts.'),(49,'Caprese Salad',_binary 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTnzlPQQMYg1n1NVfIocmNtYJflQOdZGghemA&usqp=CAU',0,'appetizer','Caprese Salad is a refreshing and vibrant dish that showcases the classic combination of ripe tomatoes, fresh mozzarella cheese, and fragrant basil leaves. It\'s a simple yet elegant salad that\'s perfect for summer.','1. Slice the tomatoes and fresh mozzarella cheese into equal-sized rounds.\n2. Arrange the tomato and mozzarella slices on a serving platter, alternating between them.\n3. Tuck fresh basil leaves between the tomato and mozzarella slices.\n4. Drizzle extra virgin olive oil and balsamic glaze over the salad.\n5. Sprinkle with salt and freshly ground black pepper.\n6. Serve the Caprese Salad immediately as a light appetizer or side dish.'),(50,'Honey Mustard Chicken',_binary 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT2F5jrGnwNmjJ1nRk6kmGC0VVA0FqkC_26tg&usqp=CAU',1,'dinner','Honey Mustard Chicken is a sweet and tangy dish that combines juicy chicken breasts with a flavorful honey mustard sauce. It\'s a versatile recipe that can be baked, grilled, or pan-fried to perfection.','1. Preheat the oven to 375¬∞F (190¬∞C).\n2. In a bowl, whisk together honey, Dijon mustard, minced garlic, lemon juice, olive oil, salt, and pepper to make the honey mustard sauce.\n3. Place chicken breasts in a baking dish and pour the honey mustard sauce over them, reserving some sauce for later.\n4. Bake the chicken for 25-30 minutes or until cooked through and golden brown.\n5. While the chicken is baking, brush with the reserved honey mustard sauce halfway through cooking.\n6. Remove the chicken from the oven and let it rest for a few minutes before serving.\n7. Serve the honey mustard chicken with roasted vegetables and a side of rice or mashed potatoes.'),(51,'Teriyaki Salmon',_binary 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQX5fBYv0gQmS0FjmXrWBMIWG9z6e581ImiXA&usqp=CAU',1,'dinner','Teriyaki Salmon is a delicious and flavorful dish featuring tender salmon fillets marinated in a homemade teriyaki sauce. It\'s a perfect balance of sweet and savory flavors that will satisfy your taste buds.','1. In a bowl, whisk together soy sauce, honey, ginger, garlic, and sesame oil to make the teriyaki marinade.\n2. Place salmon fillets in a shallow dish and pour the teriyaki marinade over them.\n3. Let the salmon marinate for at least 30 minutes in the refrigerator.\n4. Preheat the oven to 400¬∞F (200¬∞C).\n5. Remove the salmon from the marinade and place it on a baking sheet lined with parchment paper.\n6. Bake the salmon for about 12-15 minutes or until it flakes easily with a fork.\n7. Serve the Teriyaki Salmon hot, garnished with sliced green onions and sesame seeds.'),(52,'Mediterranean Chickpea Salad',_binary 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSKj-yEcqHVYOwcYZvlFzLoc_5Ykb2wXIMKCg&usqp=CAU',0,'lunch','Mediterranean Chickpea Salad is a refreshing and nutritious salad that combines protein-rich chickpeas with colorful vegetables, tangy feta cheese, and a zesty lemon-herb dressing. It\'s a perfect side dish or light lunch option.','1. In a large bowl, combine cooked chickpeas, diced cucumbers, cherry tomatoes, chopped red onions, crumbled feta cheese, and chopped fresh parsley.\n2. In a separate small bowl, whisk together lemon juice, olive oil, minced garlic, dried oregano, salt, and pepper to make the dressing.\n3. Pour the dressing over the salad ingredients and toss gently to combine.\n4. Let the salad marinate in the refrigerator for at least 30 minutes to allow the flavors to meld.\n5. Serve the Mediterranean Chickpea Salad chilled and enjoy!'),(53,'Berry Spinach Salad',_binary 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR_nvaBODo_QdE2INBqS4_k4gtSBZ72g1jvSQ&usqp=CAU',0,'lunch','Berry Spinach Salad is a vibrant and nutritious salad that combines fresh baby spinach leaves with a medley of colorful berries, crunchy almonds, and a tangy balsamic vinaigrette. It\'s a perfect balance of flavors and textures.','1. In a large salad bowl, combine baby spinach leaves, sliced strawberries, blueberries, raspberries, and sliced almonds.\n2. In a small bowl, whisk together balsamic vinegar, olive oil, honey, Dijon mustard, salt, and pepper to make the vinaigrette.\n3. Drizzle the vinaigrette over the salad and toss gently to coat.\n4. Let the salad sit for a few minutes to allow the flavors to meld.\n5. Serve the Berry Spinach Salad chilled, garnished with additional berries and sliced almonds.'),(54,'Honey Garlic Shrimp',_binary 'https://norecipes.com/wp-content/uploads/2020/05/honey-garlic-shrimp-009.jpg',1,'appetizer','Honey Garlic Shrimp is a quick and easy recipe that features succulent shrimp tossed in a sweet and savory honey garlic sauce. It\'s a perfect appetizer or main course option that can be ready in minutes.','1. In a bowl, whisk together honey, soy sauce, minced garlic, ginger, and crushed red pepper flakes.\n2. Heat oil in a skillet over medium heat.\n3. Add shrimp to the skillet and cook until pink and opaque.\n4. Remove the cooked shrimp from the skillet and set aside.\n5. In the same skillet, pour in the honey garlic sauce.\n6. Cook the sauce for a few minutes until it thickens slightly.\n7. Return the cooked shrimp to the skillet and toss to coat in the sauce.\n8. Garnish the Honey Garlic Shrimp with sliced green onions and sesame seeds.\n9. Serve the shrimp hot as an appetizer or over rice as a main course.'),(55,'Crispy Baked Chicken Drumsticks',_binary 'https://www.allrecipes.com/thmb/H9suACWxOthRWHZJ_CQBzwk3FlI=/1500x0/filters:no_upscale():max_bytes(150000):strip_icc()/Crispy-Baked-Chicken-Legs-France-C-3-by-2-2000-a47c18d4bccc471aa17a565d0def56d5.jpg',1,'dinner','Crispy Baked Chicken Drumsticks are a delicious and healthier alternative to fried chicken. The drumsticks are coated in a crispy breadcrumb and herb mixture, then baked to perfection for a crispy and juicy finish.','1. Preheat the oven to 425¬∞F (220¬∞C).\n2. In a shallow dish, combine breadcrumbs, grated Parmesan cheese, paprika, garlic powder, dried herbs, salt, and pepper.\n3. Dip chicken drumsticks into beaten eggs, then coat them in the breadcrumb mixture.\n4. Place the coated drumsticks on a greased baking sheet.\n5. Bake in the preheated oven for 35-40 minutes or until the chicken is golden brown and cooked through.\n6. Serve the Crispy Baked Chicken Drumsticks hot, garnished with fresh parsley.'),(56,'Vegetarian Stuffed Peppers',_binary 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSGkQ3S3qYmRDJWCaBOiojTnoEDm4-q3GxoSA&usqp=CAU',0,'dinner','Vegetarian Stuffed Peppers are a colorful and flavorful dish that features bell peppers filled with a mixture of quinoa, black beans, corn, and spices. They are baked to perfection, resulting in a hearty and satisfying meal.','1. Preheat the oven to 375¬∞F (190¬∞C).\n2. Cut the tops off the bell peppers and remove the seeds and membranes.\n3. In a skillet, heat olive oil over medium heat.\n4. Add diced onions and minced garlic to the skillet and cook until onions are translucent.\n5. Stir in cooked quinoa, black beans, corn, diced tomatoes, cumin, chili powder, salt, and pepper.\n6. Cook the mixture for a few minutes until heated through.\n7. Stuff the bell peppers with the quinoa and vegetable mixture.\n8. Place the stuffed bell peppers in a baking dish.\n9. Bake in the preheated oven for 25-30 minutes or until the peppers are tender.\n10. Serve the Vegetarian Stuffed Peppers hot, garnished with fresh cilantro.'),(57,'Honey Balsamic Roasted Brussels Sprouts',_binary 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR4Qy6ATfK-VQAVnX9h2L5r5ej9QK5ZKfoXEg&usqp=CAU',0,'side dish','Honey Balsamic Roasted Brussels Sprouts are a delicious and healthy side dish that features tender Brussels sprouts roasted to perfection with a sweet and tangy honey balsamic glaze. They are a perfect accompaniment to any meal.','1. Preheat the oven to 400¬∞F (200¬∞C).\n2. Trim the ends of the Brussels sprouts and cut them in half.\n3. In a bowl, whisk together olive oil, balsamic vinegar, honey, minced garlic, salt, and pepper.\n4. Toss the Brussels sprouts in the honey balsamic mixture until well coated.\n5. Spread the Brussels sprouts in a single layer on a baking sheet.\n6. Roast in the preheated oven for 20-25 minutes or until the Brussels sprouts are caramelized and tender.\n7. Serve the Honey Balsamic Roasted Brussels Sprouts hot, garnished with a drizzle of balsamic glaze.'),(58,'Berry Spinach Salad with Citrus Vinaigrette',_binary 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTIyLm8WhGE8mIQeRdm4C8Demq3gvWV67KhAA&usqp=CAU',0,'salad','Berry Spinach Salad with Citrus Vinaigrette is a refreshing and vibrant salad that combines fresh spinach leaves, mixed berries, goat cheese, and candied pecans. It is dressed with a tangy and zesty citrus vinaigrette for a burst of flavor.','1. In a large bowl, combine fresh spinach leaves, sliced strawberries, blueberries, raspberries, crumbled goat cheese, and candied pecans.\n2. In a small jar, combine freshly squeezed orange juice, lemon juice, Dijon mustard, honey, olive oil, salt, and pepper.\n3. Shake the jar vigorously to emulsify the dressing.\n4. Drizzle the citrus vinaigrette over the salad ingredients.\n5. Toss the salad gently to coat the ingredients with the dressing.\n6. Serve the Berry Spinach Salad with Citrus Vinaigrette chilled, garnished with additional berries and candied pecans.'),(59,'Pineapple Chicken Skewers',_binary 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQQYvmrXhaKIoLszwHdnGBCtRUdX255Y_IZUA&usqp=CAU',1,'dinner','Pineapple Chicken Skewers are a tropical and flavorful dish that combines marinated chicken pieces, sweet pineapple chunks, and colorful bell peppers. These skewers are grilled to perfection, creating a delicious blend of savory and sweet flavors.','1. In a bowl, whisk together soy sauce, pineapple juice, honey, minced garlic, grated ginger, sesame oil, salt, and pepper to make the marinade.\n2. Cut boneless, skinless chicken breasts into bite-sized pieces.\n3. Place the chicken pieces in the marinade, ensuring they are well coated.\n4. Cover the bowl and marinate in the refrigerator for at least 30 minutes, or up to 4 hours.\n5. Preheat the grill to medium-high heat.\n6. Thread the marinated chicken pieces, pineapple chunks, and bell pepper slices onto skewers.\n7. Grill the skewers for 10-12 minutes, turning occasionally, until the chicken is cooked through and the pineapple and peppers are slightly charred.\n8. Serve the Pineapple Chicken Skewers hot, garnished with fresh cilantro.'),(60,'Caprese Stuffed Portobello Mushrooms',_binary 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQe8kJw0maEOjh8Mtkvw_TqoApm6tD8XyRsIA&usqp=CAU',0,'dinner','Caprese Stuffed Portobello Mushrooms are a mouthwatering vegetarian dish that combines meaty Portobello mushrooms filled with a mixture of fresh tomatoes, mozzarella cheese, and basil. They are baked until the cheese is melty and gooey.','1. Preheat the oven to 400¬∞F (200¬∞C).\n2. Remove the stems from the Portobello mushrooms and scrape out the gills.\n3. In a bowl, combine diced tomatoes, shredded mozzarella cheese, chopped fresh basil, minced garlic, balsamic vinegar, salt, and pepper.\n4. Spoon the tomato and cheese mixture into the Portobello mushroom caps.\n5. Place the stuffed mushrooms on a baking sheet.\n6. Bake in the preheated oven for 15-20 minutes or until the cheese is melted and bubbly.\n7. Serve the Caprese Stuffed Portobello Mushrooms hot, garnished with a drizzle of balsamic glaze and fresh basil leaves.'),(61,'Lemon Blueberry Yogurt Loaf',_binary 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTV2rRUY20JSQ44KmicZBVSqU01b371u5a0vw&usqp=CAU',0,'dessert','Lemon Blueberry Yogurt Loaf is a moist and flavorful cake-like bread that is bursting with tangy lemon flavor and juicy blueberries. It is perfect for breakfast, brunch, or as a delicious dessert.','1. Preheat the oven to 350¬∞F (175¬∞C). Grease a loaf pan.\n2. In a large bowl, whisk together flour, baking powder, baking soda, and salt.\n3. In a separate bowl, cream together butter and sugar until light and fluffy.\n4. Beat in eggs, one at a time, then stir in lemon zest, lemon juice, vanilla extract, and Greek yogurt.\n5. Gradually add the dry ingredients to the wet ingredients, mixing until just combined.\n6. Gently fold in fresh blueberries.\n7. Pour the batter into the prepared loaf pan.\n8. Bake in the preheated oven for 50-60 minutes or until a toothpick inserted into the center comes out clean.\n9. Allow the Lemon Blueberry Yogurt Loaf to cool in the pan for 10 minutes, then transfer to a wire rack to cool completely.\n10. Serve the loaf sliced, and enjoy!'),(62,'Zucchini Noodle Stir-Fry',_binary 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRdIPc3lDQBMA5OnI_NNhj2NYyceFg1pdE5Fw&usqp=CAU',0,'dinner','Zucchini Noodle Stir-Fry is a healthy and low-carb alternative to traditional stir-fried noodles. Thinly sliced zucchini noodles are stir-fried with colorful vegetables and a flavorful sauce for a light and satisfying meal.','1. Heat sesame oil in a large skillet or wok over medium-high heat.\n2. Add sliced bell peppers, shredded carrots, sliced mushrooms, and chopped green onions to the skillet.\n3. Stir-fry the vegetables for 3-4 minutes until they are crisp-tender.\n4. Push the vegetables to one side of the skillet and add zucchini noodles to the empty space.\n5. Stir-fry the zucchini noodles for 1-2 minutes until they are slightly softened.\n6. In a small bowl, whisk together soy sauce, rice vinegar, honey, grated ginger, garlic powder, cornstarch, and water.\n7. Pour the sauce over the vegetables and zucchini noodles in the skillet.\n8. Stir-fry for an additional 1-2 minutes until the sauce thickens and coats the ingredients.\n9. Serve the Zucchini Noodle Stir-Fry hot, garnished with sesame seeds and chopped cilantro.'),(63,'Chicken Parmesan',_binary 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRFLO5_oKosdM0sRYASnQSOaa8MkpJon7p0Fg&usqp=CAU',1,'dinner','Chicken Parmesan is a classic Italian dish that features breaded chicken cutlets topped with marinara sauce and melted cheese. It\'s a hearty and satisfying meal that\'s perfect for dinner.','1. Preheat the oven to 400¬∞F (200¬∞C).\n2. In a shallow dish, mix breadcrumbs, grated Parmesan cheese, dried basil, dried oregano, salt, and pepper.\n3. Dip chicken cutlets into beaten eggs, then coat them in the breadcrumb mixture.\n4. Heat olive oil in a skillet over medium heat.\n5. Cook the breaded chicken cutlets until golden brown on both sides.\n6. Transfer the cooked chicken cutlets to a baking dish.\n7. Spoon marinara sauce over the chicken cutlets, then top with shredded mozzarella cheese.\n8. Bake in the preheated oven for 15-20 minutes or until the cheese is melted and bubbly.\n9. Serve the Chicken Parmesan hot, garnished with fresh basil leaves.'),(64,'Crispy Baked Potato Wedges',_binary 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRkwIeC317tAL25oJpwVyPQvuMn8W_kBv4nIw&usqp=CAU',0,'side dish','Crispy Baked Potato Wedges are a delicious and healthier alternative to traditional fried potato wedges. They are seasoned with herbs and spices, then baked to perfection for a crispy exterior and tender interior.','1. Preheat the oven to 425¬∞F (220¬∞C).\n2. Cut potatoes into wedges and place them in a bowl.\n3. Drizzle olive oil over the potato wedges and toss to coat.\n4. In a separate bowl, mix together salt, paprika, garlic powder, onion powder, and black pepper.\n5. Sprinkle the seasoning mixture over the potato wedges and toss to evenly coat.\n6. Arrange the seasoned potato wedges in a single layer on a baking sheet.\n7. Bake for 25-30 minutes or until the wedges are golden brown and crispy.\n8. Serve the Crispy Baked Potato Wedges hot, garnished with chopped fresh parsley.'),(66,'Vegetable Curry',_binary 'https://img.taste.com.au/yXbdfVy7/w720-h480-cfill-q80/taste/2016/11/creamy-chickpea-and-vegetable-curry-104611-1.jpeg',0,'dinner','Vegetable Curry is a flavorful and aromatic dish that combines a medley of vegetables with a rich and creamy curry sauce. It\'s a perfect vegetarian option that can be served with rice or naan bread.','1. Heat oil in a large pot or skillet over medium heat.\n2. Add diced onions and minced garlic to the pot and cook until onions are translucent.\n3. Add chopped vegetables such as bell peppers, carrots, cauliflower, and green beans to the pot.\n4. Cook the vegetables for a few minutes until they start to soften.\n5. In a separate bowl, whisk together coconut milk, tomato paste, curry powder, ground cumin, ground coriander, turmeric, salt, and pepper.\n6. Pour the coconut milk mixture over the vegetables in the pot.\n7. Stir to combine and bring the curry to a simmer.\n8. Let the curry simmer for about 15-20 minutes or until the vegetables are tender.\n9. Serve the Vegetable Curry hot, garnished with fresh cilantro leaves.\n10. Enjoy with rice or naan bread.'),(67,'Spinach and Feta Stuffed Chicken Breast',_binary 'https://i.ytimg.com/vi/5WSsg-q6zYs/maxresdefault.jpg',1,'dinner','Spinach and Feta Stuffed Chicken Breast is a flavorful and elegant dish that features tender chicken breasts filled with a mixture of saut√©ed spinach, crumbled feta cheese, and garlic. It\'s a delicious option for a special dinner or entertaining guests.','1. Preheat the oven to 375¬∞F (190¬∞C).\n2. Butterfly the chicken breasts by slicing them horizontally, but not all the way through.\n3. Season the inside of the chicken breasts with salt and pepper.\n4. In a skillet, heat olive oil over medium heat.\n5. Add minced garlic and saut√© for a minute until fragrant.\n6. Add chopped spinach to the skillet and cook until wilted.\n7. Remove the skillet from heat and let the spinach cool slightly.\n8. In a bowl, combine the cooked spinach, crumbled feta cheese, and breadcrumbs.\n9. Stuff the spinach and feta mixture into the butterflied chicken breasts.\n10. Secure the chicken breasts with toothpicks to keep the filling in place.\n11. Place the stuffed chicken breasts in a baking dish.\n12. Bake in the preheated oven for 25-30 minutes or until the chicken is cooked through.\n13. Remove the toothpicks and serve the Spinach and Feta Stuffed Chicken Breast hot, garnished with fresh herbs.'),(68,'Quinoa Salad with Roasted Vegetables',_binary 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSbjwKNJQ2E_81DqS_lC_Z7nRyPc1L7ewhN2g&usqp=CAU',0,'salad','Quinoa Salad with Roasted Vegetables is a nutritious and satisfying salad that combines fluffy quinoa with a medley of roasted vegetables and a zesty lemon vinaigrette. It\'s a perfect option for a light lunch or as a side dish.','1. Preheat the oven to 425¬∞F (220¬∞C).\n2. Toss chopped vegetables such as bell peppers, zucchini, red onions, and cherry tomatoes with olive oil, salt, and pepper.\n3. Spread the vegetables on a baking sheet in a single layer.\n4. Roast the vegetables in the preheated oven for 20-25 minutes or until they are tender and slightly caramelized.\n5. While the vegetables are roasting, cook quinoa according to package instructions.\n6. In a small bowl, whisk together lemon juice, olive oil, minced garlic, Dijon mustard, honey, salt, and pepper to make the vinaigrette.\n7. In a large bowl, combine the cooked quinoa, roasted vegetables, chopped fresh herbs, and the lemon vinaigrette.\n8. Toss to coat the salad evenly.\n9. Serve the Quinoa Salad with Roasted Vegetables at room temperature or chilled.'),(69,'Blueberry Pancake Muffins',_binary 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS1K5BUePT31gvi_Qzw-YJ3T7q7lFzErMa9CQ&usqp=CAU',0,'breakfast','Blueberry Pancake Muffins are a delightful twist on traditional pancakes. These fluffy muffins are studded with fresh blueberries and have a hint of maple syrup flavor. They are perfect for a quick and portable breakfast or snack.','1. Preheat the oven to 350¬∞F (175¬∞C).\n2. In a large bowl, whisk together flour, baking powder, salt, and cinnamon.\n3. In a separate bowl, whisk together milk, melted butter, maple syrup, vanilla extract, and beaten eggs.\n4. Pour the wet ingredients into the dry ingredients and stir until just combined.\n5. Gently fold in fresh blueberries.\n6. Divide the batter evenly among a greased or lined muffin tin.\n7. Bake in the preheated oven for 20-25 minutes or until the muffins are golden brown and a toothpick inserted into the center comes out clean.\n8. Allow the Blueberry Pancake Muffins to cool slightly before serving.'),(70,'Pesto Pasta with Roasted Tomatoes',_binary 'https://d33wubrfki0l68.cloudfront.net/eb0e4a4654b875be72e00709e6c69f2d3edc5c01/17f05/images/uploads/2021_09_12_grilled_chicken_pesto_pasta_salad_0.jpg',0,'lunch','Pesto Pasta with Roasted Tomatoes is a simple yet flavorful pasta dish that combines al dente pasta with a vibrant homemade pesto sauce and roasted cherry tomatoes. It\'s a delicious option for a quick and satisfying meal.','1. Preheat the oven to 400¬∞F (200¬∞C).\n2. Toss cherry tomatoes with olive oil, salt, and pepper on a baking sheet.\n3. Roast the tomatoes in the preheated oven for 15-20 minutes or until they are slightly wrinkled and caramelized.\n4. Cook pasta according to package instructions until al dente.\n5. Drain the cooked pasta and set aside.\n6. In a food processor, blend fresh basil, garlic, pine nuts, Parmesan cheese, lemon juice, salt, and pepper until smooth.\n7. With the food processor running, drizzle in olive oil until the pesto sauce is well combined.\n8. In a large bowl, toss the cooked pasta with the pesto sauce.\n9. Add the roasted cherry tomatoes and gently mix.\n10. Serve the Pesto Pasta with Roasted Tomatoes hot, garnished with additional Parmesan cheese and fresh basil leaves.');
